local firststart = false
local usedcommand = false
local weathercmd = ""
local weathersavailable = ""

function table.empty (self)
    for _, _ in pairs(self) do
        return false
    end
    return true
end


RegisterServerEvent("OuDayas:Weather")
AddEventHandler("OuDayas:Weather",function(operation)
    TriggerClientEvent("meteo:actu", source, Data)
    if operation == "get" then
        return "asd"
    elseif operation == "SendOnDiscord" then

    end
	checkMeteoHTTPRequest()
end)



local GetWeather = "http://api.openweathermap.org/data/2.5/weather?id="..Config.CityID.."&lang="..Config.Language .."&units=" .. Config.MeasureSystem .. "&APPID="..Config.API
function sendToDiscordMeteo(name, message, color, tag)
    local embeddata =
    {
        title = message,
        color = color,
        description = "",
        type = "rich",
        footer =
        {
            text = "------------------------"
        }
    }

    OuDayas.DiscordMessage(Config.DiscordMessage.webhook, Config.DiscordMessage.nickname, Config.DiscordMessage.avatar, embeddata, tag)
end
function TimeCalculation(time, how)
    if how == "seconds" then
        return time*1000
    elseif how == "minutes" then
        return time*60*1000
    elseif how == "hours" then
        return time*60*60*1000
    end
end

function checkMeteo(err,response)
    local data = json.decode(response)
    local type = data.weather[1].main
    local id = data.weather[1].id
    local description = data.weather[1].description
    local wind = math.floor(data.wind.speed)
    local windrot = data.wind.deg
    local meteo = "EXTRASUNNY"
    local ville = data.name
    local temp = math.floor(data.main.temp)
    local tempmini = math.floor(data.main.temp_min)
    local tempmaxi = math.floor(data.main.temp_max)
    local emoji = ":white_sun_small_cloud:"
    if type == "Thunderstorm" then
        meteo = "THUNDER"
        emoji = ":cloud_lightning:"
    end
    if type == "Rain" then
        meteo = "RAIN"
        emoji = ":cloud_snow:"
    end
    if type == "Drizzle" then
        meteo = "CLEARING"
        emoji = ":cloud:"
        if id == 608  then
            meteo = "OVERCAST"
        end
    end
    if type == "Clear" then
        meteo = "CLEAR"
        emoji = ":sun_with_face:"
    end
    if type == "Clouds" then
        meteo = "CLOUDS"
        emoji = ":cloud:"
        if id == 804  then
            meteo = "OVERCAST"
        end
    end
    if type == "Snow" then
        meteo = "SNOW"
        emoji = ":cloud_snow:"
        if id == 600 or id == 602 or id == 620 or id == 621 or id == 622 then
            meteo = "XMAS"
        end
    end

    Data = {
        Meteo = meteo,
        VitesseVent = wind,
        DirVent = windrot
    }
    -- [[
    Data = {
        ["Meteo"] = meteo,
        ["VitesseVent"] = wind,
        ["DirVent"] = windrot
    }
    --]]
    local tags = {""}

    if Config.DiscordMessage.enabled then
        if firststart == true then
            sendToDiscordMeteo(Config.DiscordMessage.nickname, emoji..
            Config.Languages[Config.Language]["DISCORD"]["UPDATE"]..": "..ville.."\n"..
            Config.Languages[Config.Language]["DISCORD"]["THEREIS"].. ": "..description..". " .. emoji.. "\n"..
            Config.Languages[Config.Language]["DISCORD"]["TEMPERATURE"].. ": :thermometer:\n" ..
            Config.Languages[Config.Language]["DISCORD"]["ACTUALTEMP"].. " " ..temp.. Config.Measurements[Config.MeasureSystem].temperature.."\n"..
            Config.Languages[Config.Language]["DISCORD"]["TEMPMIN"].. " "..tempmini.. Config.Measurements[Config.MeasureSystem].temperature.. "\n"..
            Config.Languages[Config.Language]["DISCORD"]["TEMPMAX"].." "..tempmaxi.. Config.Measurements[Config.MeasureSystem].temperature .."." .. "\n"..
            Config.Languages[Config.Language]["DISCORD"]["WIND"]..":wind_blowing_face:"..wind.. Config.Measurements[Config.MeasureSystem].speed ..".", 16711680,
        tags)
        end
        if usedcommand == false then
            if Config.DiscordMessage.UpdateOnSame == true and Data.Meteo == Cache.Last then
                if firststart == false then
                sendToDiscordMeteo(Config.DiscordMessage.nickname, emoji..
                Config.Languages[Config.Language]["DISCORD"]["UPDATE"]..": "..ville.."\n"..
                Config.Languages[Config.Language]["DISCORD"]["THEREIS"].. ": "..description..". " .. emoji.. "\n"..
                Config.Languages[Config.Language]["DISCORD"]["TEMPERATURE"].. ": :thermometer:\n" ..
                Config.Languages[Config.Language]["DISCORD"]["ACTUALTEMP"].. " " ..temp.. Config.Measurements[Config.MeasureSystem].temperature.."\n"..
                Config.Languages[Config.Language]["DISCORD"]["TEMPMIN"].. " "..tempmini.. Config.Measurements[Config.MeasureSystem].temperature.. "\n"..
                Config.Languages[Config.Language]["DISCORD"]["TEMPMAX"].." "..tempmaxi.. Config.Measurements[Config.MeasureSystem].temperature .."." .. "\n"..
                Config.Languages[Config.Language]["DISCORD"]["WIND"]..":wind_blowing_face:"..wind.. Config.Measurements[Config.MeasureSystem].speed ..".",16711680,
                tags)
                end
            elseif Config.DiscordMessage.UpdateOnSame == false and Data.Meteo ~= Cache.Last then
                if firststart == false then
                sendToDiscordMeteo(Config.DiscordMessage.nickname, emoji..
                Config.Languages[Config.Language]["DISCORD"]["UPDATE"]..": "..ville.."\n"..
                Config.Languages[Config.Language]["DISCORD"]["THEREIS"].. ": "..description..". " .. emoji.. "\n"..
                Config.Languages[Config.Language]["DISCORD"]["TEMPERATURE"].. ": :thermometer:\n" ..
                Config.Languages[Config.Language]["DISCORD"]["ACTUALTEMP"].. " " ..temp.. Config.Measurements[Config.MeasureSystem].temperature.."\n"..
                Config.Languages[Config.Language]["DISCORD"]["TEMPMIN"].. " "..tempmini.. Config.Measurements[Config.MeasureSystem].temperature.. "\n"..
                Config.Languages[Config.Language]["DISCORD"]["TEMPMAX"].." "..tempmaxi.. Config.Measurements[Config.MeasureSystem].temperature .."." .. "\n"..
                Config.Languages[Config.Language]["DISCORD"]["WIND"]..":wind_blowing_face:"..wind.. Config.Measurements[Config.MeasureSystem].speed ..".",16711680,
                tags)
                end
            end
        elseif usedcommand == true and Config.cmd.DiscordUpdate == true then
            local changedto = ""
            for i,wtype in ipairs(Config.cmd.AvailableWeatherTypes) do
                if wtype == weathercmd then
                    changedto = Config.Languages[Config.Language]["WEATHERTYPE"][weathercmd]
                end
            end
            sendToDiscordMeteo(Config.DiscordMessage.nickname, emoji..
            Config.Languages[Config.Language]["DISCORD"]["UPDATE"]..": "..ville.."\n"..
            Config.Languages[Config.Language]["DISCORD"]["THEREIS"].. ": "..changedto..". " .. emoji.. "\n"..
            Config.Languages[Config.Language]["DISCORD"]["TEMPERATURE"].. ": :thermometer:\n" ..
            Config.Languages[Config.Language]["DISCORD"]["ACTUALTEMP"].. " " ..temp.. Config.Measurements[Config.MeasureSystem].temperature.."\n"..
            Config.Languages[Config.Language]["DISCORD"]["TEMPMIN"].. " "..tempmini.. Config.Measurements[Config.MeasureSystem].temperature.. "\n"..
            Config.Languages[Config.Language]["DISCORD"]["TEMPMAX"].." "..tempmaxi.. Config.Measurements[Config.MeasureSystem].temperature .."." .. "\n"..
            Config.Languages[Config.Language]["DISCORD"]["WIND"]..":wind_blowing_face:"..wind.. Config.Measurements[Config.MeasureSystem].speed ..".",16711680,
            tags)
        end
    end
    Cache = { Last = Data.Meteo }
    firststart = false
    if Config.AutoCheckTime.enabled then
        SetTimeout(OuDayas.Time(Config.AutoCheckTime.time, Config.AutoCheckTime.type), checkMeteoHTTPRequest)
    end
    if Config.SetWeather then
        if not usedcommand then
            TriggerClientEvent("OD_Weather:SetWeather", -1, tostring(Data.Meteo) )
        end
    end
end



function checkMeteoHTTPRequest()
    PerformHttpRequest(GetWeather, checkMeteo, "GET")
end

Citizen.CreateThread(function()
    

    if Config.Enabled then
        Wait(1000)
        firststart = true
        Cache.Last = "-"
        checkMeteoHTTPRequest()
    end

    
    if not table.empty(Config.cmd.AvailableWeatherTypes) then
        for k, v in pairs(Config.cmd.AvailableWeatherTypes) do
            weathersavailable = weathersavailable .. " " .. v
        end
    end
end)

RegisterServerEvent("OD_Weather:SetServer")
AddEventHandler("OD_Weather:SetServer",function()
    TriggerClientEvent("meteo:actu", source, Data)
end)

function isAllowedToChange(player)
    local allowed = false
    for i,id in ipairs(Config.cmd.PlayersAllowed) do
        for x,pid in pairs(GetPlayerIdentifiers(player)) do
            if string.lower(pid) == string.lower(id) then
                allowed = true
            end
        end
    end
    return allowed
end

if Config.cmd.enabled then
    if Config.cmd.cmdname ~= "" then
        RegisterCommand(Config.cmd.cmdname, function(source, args)
            -- cmd console
            if source == 0 then
                local validWeatherType = false
                if args[1] == nil then
                    print(Config.Languages[Config.Language]["CMDHELP"]["INVALIDSYNTAX"].. Config.cmd.cmdname .. " [" .. Config.Languages[Config.Language]["CMDHELP"]["PARAGRAPH"] .. "]")
                    return
                else
                    for i,wtype in ipairs(Config.cmd.AvailableWeatherTypes) do
                        if wtype == (args[1]) then
                            validWeatherType = true
                        elseif (args[1]) == Config.cmd.cmdautosync then
                            validWeatherType = true
                        end
                    end
                    if validWeatherType then
                        if (args[1]) ~= Config.cmd.cmdautosync then
                            CurrentWeather = { Meteo = tostring(args[1]) }
                            TriggerClientEvent('OD_Weather:SetWeather', -1, CurrentWeather.Meteo)
                            usedcommand = true
                            weathercmd = args[1]
                            checkMeteoHTTPRequest()
                        elseif (args[1]) == Config.cmd.cmdautosync then
                            print(Config.Languages[Config.Language]["CMDHELP"]["AUTOUPDATING"])
                            usedcommand = false
                            checkMeteoHTTPRequest()
                        end
                    else
                        print(Config.Languages[Config.Language]["CMDHELP"]["WRONGTYPE"] .. weathersavailable)
                    end
                end
            else
                if isAllowedToChange(source) then
                    local validWeatherType = false
                    if args[1] == nil then
                        print(Config.Languages[Config.Language]["CMDHELP"]["INVALIDSYNTAX"] .. " - /" .. Config.cmd.cmdname .. " [" .. Config.Languages[Config.Language]["CMDHELP"]["PARAGRAPH"] .. "]")
                        return
                    else
                        for i,wtype in ipairs(Config.cmd.AvailableWeatherTypes) do
                            if wtype == (args[1]) then
                                validWeatherType = true
                            end
                            if (args[1]) == Config.cmd.cmdautosync then
                                validWeatherType = true
                            end
                        end
                        if validWeatherType then
                            if (args[1]) ~= Config.cmd.cmdautosync then
                                CurrentWeather = { Meteo = tostring(args[1]) }
                                TriggerClientEvent('OD_Weather:SetWeather', -1, CurrentWeather.Meteo)
                                usedcommand = true
                                weathercmd = args[1]
                                checkMeteoHTTPRequest()
                            elseif (args[1]) == Config.cmd.cmdautosync then
                                firststart = true
                                usedcommand = false
                                checkMeteoHTTPRequest()
                            end
                        else
                            print(Config.Languages[Config.Language]["CMDHELP"]["WRONGTYPE"] .. weathersavailable)
                        end
                    end
                else
                    TriggerClientEvent('chatMessage', source, '', {255,255,255}, '^8' .. Config.Languages[Config.Language]["CMDHELP"]["NOTALLOWED"] .. ".")
                end
            end
        end, false)
    elseif Config.cmd.cmdname == "" then
        if Config.Language == "IT" then
            print("ERRORE: Config.cmd.cmdname: configurazione invalida")
        else
            print("ERROR: Config.cmd.cmdname: invalid setting")
        end
    end
end


